/*********************************************************************
*
*       isSampleSilent
*
*  Function description
*    Checks whether a single stereo, 16 bit audio sample is audible.
*/
static char isSampleSilent (U8 * pBuf, U32 NumBytes) {
  U16 Sample;

  while (NumBytes) {
    Sample = *pBuf | (*(pBuf + 1) << 8);
    if (!((Sample < 0x0010) || (Sample >= 0xFFF0))) {
      return 0;
    }
    pBuf += 2;
    NumBytes -= 2;
  }
  return 1;
}

/*********************************************************************
*
*       _cbOnOut
*
*  Function description
*    Callback called in the context of USBD_AUDIO_Read_Task.
*    Handles data received from the host (OUT direction).
*/
static void _cbOnOut(void * pUserContext, int NumBytesReceived, U8 ** ppNextBuffer, U32 * pNextBufferSize) {
  (void)pUserContext;
  (void)pNextBufferSize;

  if (isSampleSilent(*ppNextBuffer, NumBytesReceived)) {
    _CountSilentPacket++;
  } else {
    _CountSoundPacket++;
  }
}

/*********************************************************************
*
*       _cbOnIn
*
*  Function description
*    Callback called in the context of USBD_AUDIO_Write_Task.
*    Handles data sent to the host (IN direction).
*    The callback sets the write pointer to the next chunk of
*    the static .wav file.
*/
static void _cbOnIn(void * pUserContext, const U8 ** ppNextBuffer, U32 * pNextPacketSize) {
  unsigned SampleSize;

  (void)pUserContext;
  //
  // Packet size minus the two additional audio frames reserved in PACKET_SIZE_IN_MAX.
  // The application can periodically increase SampleSize to counterbalance differences between the
  // regular sample size and the actual byte rate.
  //
  SampleSize = PACKET_SIZE_IN_MAX - (16/8 * 2);

  if (_pBufMic == NULL) {
    //
    // First packet
    //
    _pBufMic = beat_8000_mono_wav;
  } else if (((SEGGER_PTR2ADDR(_pBufMic)) + SampleSize * 2) >= (SEGGER_PTR2ADDR(&beat_8000_mono_wav[sizeof(beat_8000_mono_wav)]))) {
    //
    // Last packet
    //
    _pBufMic = beat_8000_mono_wav;
  } else {
    _pBufMic += SampleSize;
  }
  *ppNextBuffer    = _pBufMic;
  *pNextPacketSize = SampleSize;
}

/*********************************************************************
*
*       _cbOnControl
*
*  Function description
*    Callback called in ISR context.
*    Receives audio class control commands and sends appropriate
*    responses where necessary.
*/
static int _cbOnControl(void * pUserContext, U8 Event, U8 Unit, U8 ControlSelector, U8 * pBuffer, U32 NumBytes, U8 InterfaceNo, U8 AltSetting) {
  int r;

  (void)pUserContext;
  (void)InterfaceNo;
  r = 0;
  switch (Event) {
  case USB_AUDIO_PLAYBACK_START:
    //
    // Host enabled transmission.
    //
    break;
  case USB_AUDIO_PLAYBACK_STOP:
    //
    // Host disabled transmission. Some hosts do not always send this!
    //
    break;
  case USB_AUDIO_RECORD_START:
    //
    // Host enabled reception.
    //
    break;
  case USB_AUDIO_RECORD_STOP:
    //
    // Host disabled reception. Some hosts do not always send this!
    //
    break;
  case USB_AUDIO_SET_CUR:
    switch (ControlSelector) {
      case USB_AUDIO_MUTE_CONTROL:
        break;
      case USB_AUDIO_VOLUME_CONTROL:
        break;
      case USB_AUDIO_SAMPLING_FREQ_CONTROL:
        if (NumBytes == 3) {
          if (Unit == _SpeakerConfig->pUnits->FeatureUnitID) {
            if ((AltSetting > 0) && (AltSetting < _SpeakerConfig->NumFormats)) {
              _CurSpeakerFormatIndex = AltSetting - 1;
              USBD_Logf_Application("Speaker sample frequency set to %d Hz, %d bit.", _SpeakerConfig->paFormats[_CurSpeakerFormatIndex].SamFreq, _SpeakerConfig->paFormats[_CurSpeakerFormatIndex].BitResolution);
            }
          }
          if (Unit == _MicrophoneConfig->pUnits->FeatureUnitID) {
            if ((AltSetting > 0) && (AltSetting < _MicrophoneConfig->NumFormats)) {
              _CurMicrophoneFormatIndex = AltSetting - 1;
              USBD_Logf_Application("Microphone sample frequency set to %d Hz, %d bit.", _MicrophoneConfig->paFormats[_CurMicrophoneFormatIndex].SamFreq, _MicrophoneConfig->paFormats[_CurMicrophoneFormatIndex].BitResolution);
            }
          }
        }
        break;
      default:
        r = 1;
        break;
    }
    break;
  case USB_AUDIO_GET_CUR:
    switch (ControlSelector) {
      case USB_AUDIO_MUTE_CONTROL:
        pBuffer[0] = 0;
        break;
      case USB_AUDIO_VOLUME_CONTROL:
        pBuffer[0] = 0;
        pBuffer[1] = 0;
        break;
      case USB_AUDIO_SAMPLING_FREQ_CONTROL:
        if (Unit == _SpeakerConfig->pUnits->FeatureUnitID) {
          pBuffer[0] =  _SpeakerConfig->paFormats[_CurSpeakerFormatIndex].SamFreq & 0xff;
          pBuffer[1] = (_SpeakerConfig->paFormats[_CurSpeakerFormatIndex].SamFreq >> 8) & 0xff;
          pBuffer[2] = (_SpeakerConfig->paFormats[_CurSpeakerFormatIndex].SamFreq >> 16) & 0xff;
        }
        if (Unit == _MicrophoneConfig->pUnits->FeatureUnitID) {
          pBuffer[0] =  _MicrophoneConfig->paFormats[_CurMicrophoneFormatIndex].SamFreq & 0xff;
          pBuffer[1] = (_MicrophoneConfig->paFormats[_CurMicrophoneFormatIndex].SamFreq >> 8) & 0xff;
          pBuffer[2] = (_MicrophoneConfig->paFormats[_CurMicrophoneFormatIndex].SamFreq >> 16) & 0xff;
        }
        break;
      default:
        pBuffer[0] = 0;
        pBuffer[1] = 0;
        break;
    }
    break;
  case USB_AUDIO_SET_MIN:
    break;
  case USB_AUDIO_GET_MIN:
    switch (ControlSelector) {
      case USB_AUDIO_VOLUME_CONTROL:
        pBuffer[0] = 0;
        pBuffer[1] = 0xf1;
        break;
      default:
        pBuffer[0] = 0;
        pBuffer[1] = 0;
        break;
    }
    break;
  case USB_AUDIO_SET_MAX:
    break;
  case USB_AUDIO_GET_MAX:
    switch (ControlSelector) {
      case USB_AUDIO_VOLUME_CONTROL:
        pBuffer[0] = 0;
        pBuffer[1] = 0;
        break;
      default:
        pBuffer[0] = 0;
        pBuffer[1] = 0;
        break;
    }
    break;
  case USB_AUDIO_SET_RES:
    break;
  case USB_AUDIO_GET_RES:
    switch (ControlSelector) {
      case USB_AUDIO_VOLUME_CONTROL:
        pBuffer[0] = 0;
        pBuffer[1] = 1;
        break;
      default:
        pBuffer[0] = 0;
        pBuffer[1] = 0;
        break;
    }
    break;
  default:
    r = 1;
    break;
  }
  return r;
}

/*********************************************************************
*
*       _AddAudio
*
*  Function description
*    Add a USB Audio interface to the USB stack.
*/
static USBD_AUDIO_HANDLE _AddAudio(void) {
  USB_ADD_EP_INFO       EPOut;
  USB_ADD_EP_INFO       EPIn;
  USBD_AUDIO_HANDLE     hInst;

  EPOut.Flags = USB_ADD_EP_FLAG_USE_ISO_SYNC_TYPES;
  EPOut.InDir = USB_DIR_OUT;
  EPOut.Interval = 8;
  EPOut.MaxPacketSize = PACKET_SIZE_OUT_MAX;
  EPOut.TransferType = USB_TRANSFER_TYPE_ISO;
#if USB_SUPPORT_TRANSFER_ISO
  EPOut.ISO_Type = USB_ISO_SYNC_TYPE_ASYNCHRONOUS;
#endif
  EPIn.Flags = 0;
  EPIn.InDir = USB_DIR_IN;
  EPIn.Interval = 8;
  EPIn.MaxPacketSize = PACKET_SIZE_IN_MAX;
  EPIn.TransferType = USB_TRANSFER_TYPE_ISO;
  memset(&_InitData, 0, sizeof(_InitData));
  _InitData.EPOut = USBD_AddEPEx(&EPOut, NULL, 0);
  _InitData.EPIn  = USBD_AddEPEx(&EPIn, NULL, 0);
  _InitData.pfOnOut = _cbOnOut;
  _InitData.pfOnIn  = _cbOnIn;
  _InitData.OutPacketSize = PACKET_SIZE_OUT_MAX;
  _InitData.pfOnControl = _cbOnControl;
  _InitData.NumInterfaces = SEGGER_COUNTOF(_AudioInterfaces);
  _InitData.paInterfaces = _AudioInterfaces;
  hInst = USBD_AUDIO_Add(&_InitData);
  return hInst;
}

